'''Praistan Ebola''' is a [[gnome]] who looks after the [[Spirit tree]] [[farming]] patch in [[Brimhaven]]. He is one of the five [[Group of Advanced Gardeners|gardeners]] players can talk to during [[Fairy Tale I - Growing Pains]].

==Shop==
Praistan Ebola sells basic farming tools, which can be accessed by talking to him and asking ''Can you sell me something?'' It is not an actual shop and it has no set stock; each item has to be bought individually through the dialogue.
